import React, { PropTypes } from 'react';
import { createClassFromSpec } from 'react-vega';

export default createClassFromSpec('ScatterPlot', {
  "$schema": "https://vega.github.io/schema/vega/v5.json",
  "width": 400,
  "height": 300,
  "data": [
    {
      "name": 'movements',
    }
  ],
  "scales": [
    {
      "name": 'xscale',
      "type": 'nominal',
      "domain": { "data": 'movements', "field": 'time' },
      "range": 'width',
    },
    {
      "name": 'yscale',
      "type": 'quantitative',
      "domain": { "data": 'movements', "field": 'pph' },
      "nice": true,
      "range": 'height',
    },
    {
      "name": 'color',
      "type": 'quantitative',
      "domain": { "data": 'movements', "field": 'temperature_apparent' },
    }
  ],
  "marks": [
    {
      "type": 'point',
      "from": { "data": 'movements' },
    }
  ]
});
